import './posts.scss';
import React, { useContext } from 'react';
import { Link } from 'react-router-dom';
import Post from '../post/Post';
import { profile } from 'console';

const Posts = () => {
  const postss = [
    {
      id: 1,
      name: 'Vova Markelov',
      userId: 1,
      profilePic:
        'https://gamerwall.pro/uploads/posts/2022-04/1651059253_56-gamerwall-pro-p-ognennii-petukh-krasivie-oboi-69.jpg',
      desc: 'Post 1 desc',
      img: 'https://rosspectr.ru/wp-content/uploads/e/7/4/e74207731f329db374101f1b7e9ff2dd.jpeg',
    },
    {
      id: 2,
      name: 'Vova Markelov',
      userId: 2,
      profilePic:
        'https://gamerwall.pro/uploads/posts/2022-04/1651059253_56-gamerwall-pro-p-ognennii-petukh-krasivie-oboi-69.jpg',
      desc: 'Post 2 desc',
      img: 'https://rosspectr.ru/wp-content/uploads/e/7/4/e74207731f329db374101f1b7e9ff2dd.jpeg',
    },
    {
      id: 3,
      name: 'Vova Markelov',
      userId: 3,
      profilePic:
        'https://gamerwall.pro/uploads/posts/2022-04/1651059253_56-gamerwall-pro-p-ognennii-petukh-krasivie-oboi-69.jpg',
      desc: 'Post 3 desc',
      img: 'https://rosspectr.ru/wp-content/uploads/e/7/4/e74207731f329db374101f1b7e9ff2dd.jpeg',
    },
  ];

  return (
    <div className="posts">
      {postss.map((post) => {
        <Post post={post} />;
      })}
    </div>
  );
};
export default Posts;
